/* Modulos de librerías */

/* Componentes */
import Header from "../../Components/Header/Header";
import Footer from "../../Components/Footer/Footer";
import Boton from "../../Components/Boton/Boton";

/* Estilos */
import styles from "./Home.module.css";

export default function Home() {
    return (
        <>
          <Header/>
          <Main/>
          <Footer/>
        </>
    );
}

function Main() {
  return (
    <main className={styles["main-container"]}>
      <section className={styles["top-level-section"]}>
        <h1>Inicio de sesión</h1>
        <div className={styles["separator-div"]}>
          <section className = {styles["left-section"]}>
            <h2>Credenciales</h2>
            <form action="" method="POST" className={styles["form-container"]}>
              <div className={styles["form-input-container"]}>
                <label for="username-register-form">Nombre de usuario</label>
                <input id="username-register-form" name="username" type="text"></input>
              </div>

              <div className={styles["form-input-container"]}>
                <label for="password-register-form">Contraseña</label>
                <input id="password-register-form" name="password" type="password"></input>
              </div>

              <div className={styles["form-input-container"]}>
                <label for="passwordAgain-register-form" type="password">Repita su constraseña</label>
                <input id="passwordAgain-register-form" name="passwordAgain" type="password"></input>
              </div>

              <div className={styles["buttons-container"]}>
                <Boton type="submit" onClickFunction={(event) => Debug(event, "Click hecho en Aceptar")}/>
                <Boton type="reset"  onClickFunction={(event) => Debug(event, "Click hecho en Limpiar")}/>
                <Boton/>
              </div>
            </form>
          </section>

          <section className={styles["right-section"]}>
            <h2>Bienvenido</h2>
            <p>¿No tienes una cuenta?</p>
            <a>Regístrate</a>
          </section>
        </div>
      </section>
    </main> 
  );
}

// BORRAR, SOLO PARA TESTING.
function Debug(event, msg) {
  event.preventDefault();
  console.log(msg);
}
